def maxCoins(nums) -> int:
        nums = [1] + nums + [1]
        
        @lru_cache(None)
        def dfs(i, j):
            return max([nums[i]*nums[k]*nums[j] + dfs(i,k) + dfs(k,j) for k in range(i+1, j)] or [0])
        
        return dfs(0, len(nums) - 1)
